import { ReactNode } from 'react';
import { Container, ModalDiv , ModalContent} from './styles'

interface ModalProps{
    onClose: () => void;
    children: ReactNode;
}
export function  Modal({onClose,children}: ModalProps){
    return (
        <Container>
                <ModalDiv>
                    <button onClick={onClose}>Close</button>
                </ModalDiv>
                <ModalContent>
                    <input/>
                </ModalContent>
        </Container>
    );
}
